export class TraitementChelateurReçu
{
    VisiteId:number;
    ChelateurId:number;
    Posologie:number;
    Depuis:number;
    Voie:string;
    Observance:string;
    constructor()
    {
        this.VisiteId=0;
        this.ChelateurId=0;
        this.Posologie=0.0;
        this.Depuis=0;
        this.Voie='';
        this.Observance='';

    }
}
